import React from 'react';
import './App.css';
import TitleComponent from './Components/TitleComponent';

function ChangeTitle(NewTitle) {
  document.getElementById("tc").title = NewTitle;
}

function App() {
  return (
    <div className="App">
      <TitleComponent id="tc" title={"New title"}></TitleComponent>
      <button onClick={ChangeTitle("yoooo")}>click me to change title</button>
    </div>
  );
}

export default App;
